(8, 'CBMC  is working diligently to build up a skilled', '<p>Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category. Through the implementation of vision 2021 the country continues to express its aspiration to join the middle income country by 2021 and also by 2041, expecting herself as a developed country CBMC is working diligently to build up a skilled and meritorious human resources who are the crying need to achieve this goal</p>', 'Latest News', 'assets/uploads/blog/1599638669.jpg', '', 1, 1, '2019-03-23 02:31:32', '2020-09-11 21:12:47'),
(10, 'CBMC is contributing this gigantic task to fetch', '<p>At the dawn of the creation, man intends to disclose himself to others. This trait of disclosure is man&rsquo;s instinctive quality. &ldquo;CBMC &rdquo; is contributing this gigantic task to fetch the hidden talent out of the tender hearted students taking part in co-educational process along with pragmatic timely academic education for the betterment of these backward communities to make themselves perfect citizen. This institution is playing a pioneer role to develop human resources upholding the actual scientific and technology based education method</p>', 'Latest News', 'assets/uploads/blog/1599638641.jpg', '', 1, 1, '2019-03-23 02:32:12', '2020-09-11 21:12:22'),
